import React,{ useEffect, useState } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';

function Form() {

    useEffect(() => {
        document.title = 'from';
    });

    const ddd = [];

    const dddd = async () =>{
        const res = await axios.get('/api/vacancy');

        res.data.forEach(element => {
            ddd.push(element);
        });
    }
    dddd()
    const animals = [
        { id: 1, animal: "Dog" },
        { id: 2, animal: "Bird" },
        { id: 3, animal: "Cat" },
        { id: 4, animal: "Mouse" },
        { id: 5, animal: "Horse" }
      ];
    

    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>from</h1>
            <ul>
            {animals.map(anim => (
                <li key={anim.id}>{anim.animal}</li>
            ))}
            </ul>
            
            
        </>
    )
}

export default Form
